import { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getHeroById } from "../../redux/heroes/operations";
import { selectHeroById } from "../../redux/heroes/selectors";
import Container from "../Container/Container";
import {
  FlexContainer,
  ImageBox,
  Image,
  ContentBox,
  Text,
} from "./Details.styled";
import Loader from "../Loader/Loader";
import {
  removeHeroById,
  getHeroes,
  updateHero,
} from "../../redux/heroes/operations";

const Details = () => {
  const { heroId } = useParams();
  const [isEdit, setIsEdit] = useState(false);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const hero = useSelector((state) => selectHeroById(state, heroId));

  const [formData, setFormData] = useState({
    nickname: "",
    real_name: "",
    origin_description: "",
    superpowers: "",
    catch_phrase: "",
  });

  useEffect(() => {
    if (hero) {
      setFormData({
        nickname: hero.nickname,
        real_name: hero.real_name,
        origin_description: hero.origin_description,
        superpowers: hero.superpowers,
        catch_phrase: hero.catch_phrase,
      });
    }
  }, [hero]);

  useEffect(() => {
    dispatch(getHeroById(heroId));
  }, [dispatch, heroId]);

  const handleRemoveClick = async () => {
    await dispatch(removeHeroById(heroId));
    await dispatch(getHeroes());
    navigate("/");
  };

  const handleUpdateClick = () => {
    setIsEdit(true);
  };

  const handleSaveClick = () => {
    dispatch(updateHero({ id: heroId, formData }));
    console.log(heroId);
    console.log(formData);
    setIsEdit(false);
  };

  const handleChangeInputValue = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  return (
    <>
      {hero ? (
        <Container>
          <FlexContainer>
            {isEdit ? (
              <ImageBox>
                <Image src={hero.images} alt={hero.nickname} />
                <input type="file" />
              </ImageBox>
            ) : (
              <ImageBox>
                <Image src={hero.images} alt={hero.nickname} />
              </ImageBox>
            )}
            <ContentBox>
              <Text>
                nickname:
                {isEdit ? (
                  <input
                    onChange={handleChangeInputValue}
                    value={formData.nickname}
                    name="nickname"
                    type="text"
                  />
                ) : (
                  <span>{hero.nickname}</span>
                )}
              </Text>
              <Text>
                real_name:
                {isEdit ? <input type="text" /> : <span>{hero.real_name}</span>}
              </Text>
              <Text>
                origin_description:
                {isEdit ? (
                  <input type="text" />
                ) : (
                  <span>{hero.origin_description}</span>
                )}
              </Text>
              <Text>
                superpowers:
                {isEdit ? (
                  <input type="text" />
                ) : (
                  <span>{hero.superpowers}</span>
                )}
              </Text>
              <Text>
                catch_phrase:
                {isEdit ? (
                  <input type="text" />
                ) : (
                  <span>{hero.catch_phrase}</span>
                )}
              </Text>
              {isEdit ? (
                <button onClick={handleSaveClick}>save</button>
              ) : (
                <button onClick={handleUpdateClick}>edit</button>
              )}
              <button onClick={handleRemoveClick}>remove</button>
            </ContentBox>
          </FlexContainer>
        </Container>
      ) : (
        <Loader />
      )}
    </>
  );
};

export default Details;
